  },
  unmounted() {
    if (this.broadcastInterval) {
      clearInterval(this.broadcastInterval);
    }
  },
  methods: {
    async getDefaultAddress() {
      let v = this;
      const local_address = await v.action.getAddress();
      this.address = local_address;
    },
    goBack() {
      this.$router.push("/box/win");
    },
    showGodWin() {
      this.gamesStatus = "godWin";
      const selectGod = this.godsIndex;
      const winBonus = this.bonus;
      let index = 0;
      let count = 0;
      this.rang = setInterval(() => {
        index += 1;
        count +=1;
        this.godsIndex = index % 9;
        this.bonus = this.cards_bonus[this.godsIndex];

        if (count > 10 && !this.showCoinSvg) {
          this.showCoinAni();
        }
        if (count >= 40) {
          this.godsIndex = selectGod;
          this.bonus = winBonus;
          clearInterval(this.rang);
        }
      }, 100);
    },
    showCoinAni() {
      this.showCoinSvg = true;
      setTimeout(() => {
        this.showCoinSvg = false;
      }, 1000 * 7);
    },
    gamePlay(item, index) {
      if (this.godInfoRotate) {
        return;
      }
      const cardsIndex = [];
      this.gameGods.forEach(item => {
        cardsIndex.push(item.index + 1);
      });
      this.selectGodIndex = index;
      this.godsIndex = item.index;
      this.setSelectGod = true;
      const timestamp = parseInt(new Date().getTime() / 1000);
      let v = this;
      const address = v.myWeb3.utils.toChecksumAddress(this.address);
      fetch(`/api/v1/nonce?address=${address}`, {
        method: "GET",
        mode: "cors",
      }).then(async (res) => {
        const nonceRes = await res.json();
        const cards = "[" + cardsIndex.toString().replaceAll(",", " ") + "]";
const PlayGameSignMsg = `
trojan-box wants you to sign in with your Ethereum account:
${address}
for play game
Nonce: ${nonceRes.data}
Timestamp: ${timestamp}
Cards: ${cards}
Chosen: ${this.selectGodIndex}
`;

        const msg = v.myWeb3.utils.keccak256(PlayGameSignMsg);
        v.myWeb3.eth.sign(msg, address).then(sign => {
          const signBytes = v.myWeb3.utils.hexToBytes(sign);
          signBytes[64] -= 27;
          sign = v.myWeb3.utils.bytesToHex(signBytes);
          const param = {
            address: address,
            nonce: nonceRes.data,
            signed_msg: sign,
            cards: cardsIndex,
            chosen: this.selectGodIndex,
            timestamp: timestamp.toString()
          }
          fetch("/api/v1/game/play", {
            method: "POST",
            mode: "cors",
            headers: {
              "Content-Type": "application/json",
            },
            body: JSON.stringify(param),
          }).then(async (res) => {
            if (res.ok) {
              const result = await res.json();
              this.getGameInfo(result.data.session).then(gameInfo => {
                this.cards_bonus = gameInfo.data.cards_bonus;
                this.bonus = gameInfo.data.bonus;
                // this.godInfoRotate = !this.godInfoRotate;
                this.gamesStatus = 'godInfo'
              });

            } else {
              // return Promise.reject("game play", res);
              console.log("game play error", res);
            }
          })
        });
      })
    },
    getGameInfo(session) {
      const token = this.$store.state.trojanBox.token;
      return fetch("/api/v1/game/" + session, {
        method: "GET",
        mode: "cors",
        headers: {
          "Authorization": "Bearer " + token
        },
      }).then(res => {
        return res.json();
      })
    },
    turnCard() {
      this.gamesStatus = '';
      this.showCoinSvg = false;
      setTimeout(() => {
        this.godInfoRotate = !this.godInfoRotate;
      }, 100);
    },
    getBroadcast() {
      let language = window.lang;
      if (language === 'zh') {
        language = "zh_CN";
      }
      fetch("/api/v1/broadcast?page=0&size=20", {
        method: "GET",
        mode: "cors",
        headers: {
          lang: language,
        }
      }).then(async (res) => {
        const result = await res.json();
        this.broadcasts = result.data.items;
      })
    },
    runMarquee() {
      this.stopMarquee();
      this.timerMarquee = requestAnimationFrame(this.landscapeMarquee);
    },
    stopMarquee() {
      this.timerMarquee && cancelAnimationFrame(this.timerMarquee);
    },
    //
    landscapeMarquee() {
      this.$refs.gameMarqueeItem.clientWidth + this.$refs.gameMarqueeWrapper.scrollLeft >= this.$refs.gameMarqueeItem.scrollWidth ?
          this.$refs.gameMarqueeWrapper.scrollLeft = 0 : this.$refs.gameMarqueeWrapper.scrollLeft++;
